import { prisma } from '../lib/prisma.js';
import { logger } from '../lib/logger.js';

export interface LeadFilters {
  tenantId: string;
  status?: string;
  origin?: string;
  ownerId?: string;
  search?: string;
  tags?: string[];
  dateFrom?: Date;
  dateTo?: Date;
