    logger.info({ userId: user.id, email: user.email }, 'User login successful');

    return res.json({
      success: true,
      user: {
        id: user.id,
        email: user.email,
        name: user.name,
        role: (normalizedRole || 'AGENT').toLowerCase(),
        tenantId: user.tenant_id ?? undefined,
        workspace: user.tenant?.name
      },
      token,
      refreshToken: token,
      expiresIn: env.JWT_EXPIRES_IN
    });
