  tenantId: string;
  name: string;
  email?: string | null;
  phone?: string | null;
  origin?: string | null;
  status?: string | null;
  ownerId?: string | null;
  tags?: string[];
  customFields?: Record<string, unknown>;
  metadata?: Record<string, unknown>;
